"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[54497],{18460:(a,e,i)=>{i.r(e),i.d(e,{assets:()=>s,contentTitle:()=>r,default:()=>k,frontMatter:()=>t,metadata:()=>z,toc:()=>c});var o=i(85893),n=i(11151);const t={title:"Kilka pyta\u0144 do - cz\u0119\u015b\u0107 4",authors:"mojk",date:"2015-03-31",tags:["warsztat","wywiady","spolecznosc","wywiad"],coverImage:"1981-IBM-PC5150_a-e1425884892248.jpg"},r=void 0,z={permalink:"/kilka-pytan-do-czesc-4",editUrl:"https://github.com/techwriter-pl/techwriter-pl.github.io/tree/main/blog/kilka-pytan-do-czesc-4/index.md",source:"@site/blog/kilka-pytan-do-czesc-4/index.md",title:"Kilka pyta\u0144 do - cz\u0119\u015b\u0107 4",description:"W dzisiejszym odcinku pod gradobiciem pyta\u0144 znalaz\u0142a si\u0119 Agnieszka, kt\xf3ra od",date:"2015-03-31T00:00:00.000Z",formattedDate:"31 marca 2015",tags:[{label:"warsztat",permalink:"/tags/warsztat"},{label:"wywiady",permalink:"/tags/wywiady"},{label:"spolecznosc",permalink:"/tags/spolecznosc"},{label:"wywiad",permalink:"/tags/wywiad"}],readingTime:6.215,hasTruncateMarker:!0,authors:[{name:"Micha\u0142 Skowron",role:"Administrator",url:"https://github.com/docdeveloper",imageURL:"https://github.com/docdeveloper.png",key:"mojk"}],frontMatter:{title:"Kilka pyta\u0144 do - cz\u0119\u015b\u0107 4",authors:"mojk",date:"2015-03-31",tags:["warsztat","wywiady","spolecznosc","wywiad"],coverImage:"1981-IBM-PC5150_a-e1425884892248.jpg"},unlisted:!1,prevItem:{title:"Dokumentali\u015bci w kulturze masowej",permalink:"/dokumentalisci-w-kulturze-masowej"},nextItem:{title:"Oferta pracy: Technical Writer",permalink:"/oferta-pracy-technical-writer-7"}},s={authorsImageUrls:[void 0]},c=[{value:"Jak d\u0142ugo pracujesz jako Tech Writer?",id:"jak-d\u0142ugo-pracujesz-jako-tech-writer",level:4},{value:"W jaki spos\xf3b zosta\u0142a\u015b Tech Writerem?",id:"w-jaki-spos\xf3b-zosta\u0142a\u015b-tech-writerem",level:4},{value:"Czy mo\u017cesz opowiedzie\u0107 co\u015b o swojej firmie i zespole w kt\xf3rym pracujesz?",id:"czy-mo\u017cesz-opowiedzie\u0107-co\u015b-o-swojej-firmie-i-zespole-w-kt\xf3rym-pracujesz",level:4},{value:"W jakis spos\xf3b jest zorganizowana praca Twoja i Twojego zespo\u0142u?",id:"w-jakis-spos\xf3b-jest-zorganizowana-praca-twoja-i-twojego-zespo\u0142u",level:4},{value:"Jakich narz\u0119dzi u\u017cywasz i co o nich s\u0105dzisz?",id:"jakich-narz\u0119dzi-u\u017cywasz-i-co-o-nich-s\u0105dzisz",level:4},{value:"W jaki spos\xf3b zdobywasz informacje potrzebne do tworzenia dokumentacji?",id:"w-jaki-spos\xf3b-zdobywasz-informacje-potrzebne-do-tworzenia-dokumentacji",level:4},{value:"Jakie dokumenty dostarczasz, w jakiej postaci, w jakich j\u0119zykach i jak s\u0105 one publikowane?",id:"jakie-dokumenty-dostarczasz-w-jakiej-postaci-w-jakich-j\u0119zykach-i-jak-s\u0105-one-publikowane",level:4},{value:"Jakie produkty opisujesz?",id:"jakie-produkty-opisujesz",level:4},{value:"Czy opr\xf3cz tworzenia dokumentacji zajmujesz si\u0119 czym\u015b jeszcze, np. tworzeniem materia\u0142\xf3w marketingowych? Je\u015bli tak, to czym i jakich narz\u0119dzi do tego u\u017cywasz?",id:"czy-opr\xf3cz-tworzenia-dokumentacji-zajmujesz-si\u0119-czym\u015b-jeszcze-np-tworzeniem-materia\u0142\xf3w-marketingowych-je\u015bli-tak-to-czym-i-jakich-narz\u0119dzi-do-tego-u\u017cywasz",level:4},{value:"Jakie s\u0105 najwi\u0119ksze wyzwania, kt\xf3re napotykasz w swojej pracy?",id:"jakie-s\u0105-najwi\u0119ksze-wyzwania-kt\xf3re-napotykasz-w-swojej-pracy",level:4},{value:"Co najbardziej lubisz w pracy Tech Writera?",id:"co-najbardziej-lubisz-w-pracy-tech-writera",level:4},{value:"Co by\u015b radzi\u0142a osobom, kt\xf3re chcia\u0142yby zacz\u0105\u0107 swoj\u0105 przygod\u0119 z pisaniem dokumentacji?",id:"co-by\u015b-radzi\u0142a-osobom-kt\xf3re-chcia\u0142yby-zacz\u0105\u0107-swoj\u0105-przygod\u0119-z-pisaniem-dokumentacji",level:4}];function d(a){const e={a:"a",h4:"h4",p:"p",...(0,n.a)(),...a.components};return(0,o.jsxs)(o.Fragment,{children:[(0,o.jsx)(e.p,{children:"W dzisiejszym odcinku pod gradobiciem pyta\u0144 znalaz\u0142a si\u0119 Agnieszka, kt\xf3ra od\nd\u0142u\u017cszego czasu zajmuje si\u0119 tworzeniem dokumentacji w mi\u0119dzynarodowej\nkorporacji. W wolnym czasie czyta techwriter.pl i dba o to, \u017ceby\u015bmy si\u0119 nie\nnudzili. Zapraszamy do lektury."}),"\n",(0,o.jsx)(e.h4,{id:"jak-d\u0142ugo-pracujesz-jako-tech-writer",children:"Jak d\u0142ugo pracujesz jako Tech Writer?"}),"\n",(0,o.jsx)(e.p,{children:"W marcu mijaj\u0105 3 lata."}),"\n",(0,o.jsx)(e.h4,{id:"w-jaki-spos\xf3b-zosta\u0142a\u015b-tech-writerem",children:"W jaki spos\xf3b zosta\u0142a\u015b Tech Writerem?"}),"\n",(0,o.jsx)(e.p,{children:"Tech writerem zosta\u0142am troch\u0119 z przypadku. Na pi\u0105tym roku studi\xf3w zacz\u0119\u0142am\nrozgl\u0105da\u0107 si\u0119 za jakim\u015b sta\u0142ym zaj\u0119ciem. Szuka\u0142am stanowiska, na kt\xf3rym mog\u0142abym\nwykorzysta\u0107 znajomo\u015b\u0107 j\u0119zyka angielskiego. Przegl\u0105da\u0142am oferty praktyk i sta\u017cy,\nchodzi\u0142am na rozmowy kwalifikacyjne. W ko\u0144cu trafi\u0142am na ofert\u0119 praktyk jako\nTechnical Writer w IBM. Wcze\u015bniej nie bra\u0142am pod uwag\u0119 takiej \u015bcie\u017cki zawodowej.\nW og\xf3le nie wiedzia\u0142am, \u017ce istnieje co\u015b takiego jak technical writing! Na\nuczelni m\xf3wiono tylko o standardach typu t\u0142umacz, nauczyciel, ewentualnie\nksi\u0119gowy."}),"\n",(0,o.jsx)(e.h4,{id:"czy-mo\u017cesz-opowiedzie\u0107-co\u015b-o-swojej-firmie-i-zespole-w-kt\xf3rym-pracujesz",children:"Czy mo\u017cesz opowiedzie\u0107 co\u015b o swojej firmie i zespole w kt\xf3rym pracujesz?"}),"\n",(0,o.jsx)(e.p,{children:"IBM to korporacja o ugruntowanej pozycji rynkowej. Nawet je\u017celi kto\u015b nigdy nie\nmia\u0142 okazji u\u017cywa\u0107 naszego oprogramowania ani nie s\u0142ysza\u0142 o Watsonie, na pewno\nstyka si\u0119 z innymi naszymi produktami, jak chocia\u017cby kasy fiskalne, w \u017cyciu\ncodziennym. Jak w wielu przypadkach, nasz zesp\xf3\u0142 jest mi\u0119dzynarodowy, ale spora\njego cz\u0119\u015b\u0107 znajduje si\u0119 w Krakowie. Mamy osoby o r\xf3\u017cnym wykszta\u0142ceniu, od\nfizyk\xf3w, przez programist\xf3w (co oczywiste), po absolwent\xf3w filologii\nangielskiej. Przyczynia si\u0119 to do r\xf3\u017cnorodno\u015bci opinii, co moim zdaniem ma dobry\nwp\u0142yw zar\xf3wno na \u015brodowisko pracy jak i jako\u015b\u0107 naszych produkt\xf3w."}),"\n",(0,o.jsx)(e.h4,{id:"w-jakis-spos\xf3b-jest-zorganizowana-praca-twoja-i-twojego-zespo\u0142u",children:"W jakis spos\xf3b jest zorganizowana praca Twoja i Twojego zespo\u0142u?"}),"\n",(0,o.jsx)(e.p,{children:"Technical writerzy nie tworz\u0105 osobnego zespo\u0142u, tylko przynale\u017c\u0105 do\nposzczeg\xf3lnych zespo\u0142\xf3w produktowych. Dokumentacj\u0119 do naszego produktu pisz\u0105\ncztery osoby. Trzy znajduj\u0105 sie w Krakowie, jedna w Wielkiej Brytanii. Ka\u017cdy z\nnas jest odpowiedzialny za jaka\u015b cz\u0119\u015b\u0107, na przyk\u0142ad instalacj\u0119, ale nie jest to\nsztywny podzia\u0142. Wynika raczej z naturalnych zainteresowa\u0144 ni\u017c z narzuconej\nbiurokracji. Cz\u0119sto \u015bmiej\u0119 si\u0119, \u017ce tworzymy \u201edream team\u201d, bo ka\u017cdemu uda\u0142o si\u0119\nznale\u017a\u0107 co\u015b dla siebie. Mimo \u017ce ka\u017cdy z nas ma swoj\u0105 domen\u0119, staramy si\u0119 by\u0107\nzorientowani w tym, co robi\u0105 pozosta\u0142e osoby. W ten spos\xf3b, kiedy jedno z nas\nidzie na urlop lub zwolnienie, kto\u015b inny jest w stanie przej\u0105\u0107 jego prac\u0119 bez\nwi\u0119kszego problemu."}),"\n",(0,o.jsx)(e.h4,{id:"jakich-narz\u0119dzi-u\u017cywasz-i-co-o-nich-s\u0105dzisz",children:"Jakich narz\u0119dzi u\u017cywasz i co o nich s\u0105dzisz?"}),"\n",(0,o.jsx)(e.p,{children:"Do tej pory moim g\u0142\xf3wnym narz\u0119dzniem by\u0142 Arbortext Editor. Mia\u0142am te\u017c styczno\u015b\u0107\nz Oxygen XML Author i Adobe FrameMaker. Pewnie jest to kwestia przyzwyczajenia,\nale Arbortext jest moim faworytem. By\u0142o to pierwsze narz\u0119dzie do tworzenia\ndokumentacji technicznej, jakie pozna\u0142am i pewnie dlatego wydaje mi si\u0119\nnajbardziej intuicyjne i przyjazne dla u\u017cytkownika. Oxygen nie przypad\u0142 mi do\ngustu g\u0142\xf3wnie ze wzgl\u0119du na interfejs. Kiedy po raz pierwszy otworzy\u0142am plik w\nOxygenie, po\u0142ow\u0119 okna zajmowa\u0142y dodatkowe panele. Wiem, \u017ce mo\u017cna je dostosowa\u0107\ndo swoich potrzeb, ale pierwsze wra\u017cenie skutecznie mnie zniech\u0119ci\u0142o. FrameMaker\nz kolei kompletnie nie jest dla mnie. Jestem przyzwyczajona do narz\u0119dzi do\ntworzenia dokumentacji on-line. Przysz\u0142o mi jednak pracowa\u0107 nad jedn\u0105\npublikacj\u0105, kt\xf3ra mia\u0142a form\u0119 ksi\u0105\u017cki. Przestawienie si\u0119 z Arbortexta na\nFrameMakera by\u0142o trudn\u0105 spraw\u0105. Odetchn\u0119\u0142am z ulga, kiedy projekt si\u0119 sko\u0144czy\u0142\n\ud83d\ude09"}),"\n",(0,o.jsx)(e.h4,{id:"w-jaki-spos\xf3b-zdobywasz-informacje-potrzebne-do-tworzenia-dokumentacji",children:"W jaki spos\xf3b zdobywasz informacje potrzebne do tworzenia dokumentacji?"}),"\n",(0,o.jsx)(e.p,{children:"Za\u0142o\u017cenie jest takie, \u017ce wszystkie potrzebne informacje znajduj\u0105 si\u0119 w systemie\ndo zarz\u0105dzania projektem. Scrum master przypisuje mi jakie\u015b zadanie, czytam\nopis, loguj\u0119 si\u0119 do aplikacji i powinnam by\u0107 w stanie udokumentowa\u0107 dan\u0105\nfunkcjonalno\u015b\u0107 lub procedur\u0119. Rzeczywisto\u015b\u0107 wygl\u0105da jednak nieco inaczej \ud83d\ude09.\nJe\u017celi dokumentuj\u0119 prost\u0105 funkcjonalno\u015b\u0107, kt\xf3r\u0105 \u0142atwo wywnioskowa\u0107 z interfejsu,\nto po prostu loguj\u0119 si\u0119 do aplikacji, sama pr\xf3buj\u0119 przej\u015b\u0107 dan\u0105 procedur\u0119, a\npotem j\u0105 opisuj\u0119. Taki dokument daj\u0119 do przeczytania deweloperowi, kt\xf3ry\nimplementowa\u0142 funkcjonalno\u015b\u0107 oraz testerowi. Oni dostaraczaj\u0105 komentarzy\nodno\u015bnie szczeg\xf3\u0142\xf3w, kt\xf3rych nie by\u0142am w stanie sama si\u0119 domy\u015bli\u0107, na przyk\u0142ad,\nna temat ogranicze\u0144 danej funkcjonalno\u015bci. Je\u017celi do udokumentowania mam co\u015b\ninnego ni\u017c procedur\u0119 do wyklikania na interfejsie, na przyk\u0142ad parametry,\nkt\xf3rych mo\u017cna u\u017cy\u0107 z komend\u0105 albo wymagania sprz\u0119towe, zaczynam od przejrzenia\nopisu story implementuj\u0105cego dan\u0105 funkcjonalno\u015b\u0107. Mo\u017cna tam zazwyczaj znale\u017a\u0107\nsporo przydatnych informacji. Uzbrojona w podstawy, kartk\u0119 i d\u0142ugopis udaj\u0119 si\u0119\npo szczeg\xf3\u0142y do w\u0142a\u015bciwej osoby. Reszta pracy wygl\u0105da tak samo: pisz\u0119, wysy\u0142am\ndo sprawdzenia, dostaj\u0119 komentarze i uzupe\u0142niam na ich podstawie dokumentacj\u0119."}),"\n",(0,o.jsx)(e.h4,{id:"jakie-dokumenty-dostarczasz-w-jakiej-postaci-w-jakich-j\u0119zykach-i-jak-s\u0105-one-publikowane",children:"Jakie dokumenty dostarczasz, w jakiej postaci, w jakich j\u0119zykach i jak s\u0105 one publikowane?"}),"\n",(0,o.jsx)(e.p,{children:"Nasz zesp\xf3\u0142 dostarcza dokumentacj\u0119 w postaci pomocy on-line. U\u017cywamy standardu\nDITA (stworzonego zreszt\u0105 przez IBM), dlatego nasza dokumentacja jest podzielona\nna trzy rodzaje temat\xf3w: zadania (ang. tasks), poj\u0119cia (ang. concepts) i\nmateria\u0142y zale\u017cne (ang. reference). Piszemy po angielsku, ale nasza dokumentacja\njest p\xf3\u017aniej t\u0142umaczona na inne j\u0119zyki."}),"\n",(0,o.jsx)(e.h4,{id:"jakie-produkty-opisujesz",children:"Jakie produkty opisujesz?"}),"\n",(0,o.jsx)(e.p,{children:"Opisuj\u0119 dwa produkty, kt\xf3re s\u0142u\u017c\u0105 do zarz\u0105dzania licencjami oprogramowania.\nOg\xf3lnie chodzi o to, \u017ceby klient m\xf3g\u0142 sprawdzi\u0107, jakie programy s\u0105 zainstalowane\nna komputerach w jego firmie, ile ich jest oraz jak cz\u0119sto s\u0105 u\u017cywane. Na\npodstawie tych informacji powinien by\u0107 w stanie stwierdzi\u0107, czy spe\u0142nia wymogi\nlicencyjne dla danego oprogramowania, czy musi co\u015b uregulowa\u0107."}),"\n",(0,o.jsx)(e.h4,{id:"czy-opr\xf3cz-tworzenia-dokumentacji-zajmujesz-si\u0119-czym\u015b-jeszcze-np-tworzeniem-materia\u0142\xf3w-marketingowych-je\u015bli-tak-to-czym-i-jakich-narz\u0119dzi-do-tego-u\u017cywasz",children:"Czy opr\xf3cz tworzenia dokumentacji zajmujesz si\u0119 czym\u015b jeszcze, np. tworzeniem materia\u0142\xf3w marketingowych? Je\u015bli tak, to czym i jakich narz\u0119dzi do tego u\u017cywasz?"}),"\n",(0,o.jsx)(e.p,{children:"Poza pisaniem dokumentacji tworz\u0119 te\u017c infografiki oraz filmy instrukta\u017cowe. Do\ntych pierwszych u\u017cywam CorelDraw, do tych drugich Camtasia Studio. Opr\xf3cz tego,\nwsp\xf3lnie z koleg\u0105 z zespo\u0142u przygotowujemy wewn\u0119trzne prezentacje nowych wersji\nproduktu."}),"\n",(0,o.jsx)(e.h4,{id:"jakie-s\u0105-najwi\u0119ksze-wyzwania-kt\xf3re-napotykasz-w-swojej-pracy",children:"Jakie s\u0105 najwi\u0119ksze wyzwania, kt\xf3re napotykasz w swojej pracy?"}),"\n",(0,o.jsx)(e.p,{children:"Wyzwa\u0144 jest sporo. Po pierwsze, przeskok z poziomu przeci\u0119tnego u\u017cytkownika\nkomputera do poziomu osoby, kt\xf3ra t\u0142umaczy u\u017cytkownikom, jak wykona\u0107\nskomplikowan\u0105 procedur\u0119 na AIXie. Na pocz\u0105tku pracy mocno odczuwa\u0142am braki w\nwiedzy technicznej, co cz\u0119sto sprawia\u0142o, \u017ce czu\u0142am si\u0119 jak przedszkolak, kt\xf3rego\nprzez pomy\u0142k\u0119 zapisano na studia doktoranckie. Musia\u0142am te\u017c prze\u0142ama\u0107 wewn\u0119trzn\u0105\nblokad\u0119 przed zadawniem pyta\u0144, kt\xf3re wydawa\u0142y mi si\u0119 g\u0142upie lub oczywiste z\npunktu widzenia os\xf3b, z kt\xf3rymi rozmawia\u0142am. Teraz si\u0119 tym nie przejmuj\u0119, tylko\ndr\u0105\u017c\u0119 temat do skutku \ud83d\ude09 Innym problemem jest to, \u017ce dokumentacja ma ni\u017cszy\npriorytet ni\u017c tworzenie aplikacji. Jest to oczywi\u015bcie zrozumia\u0142e, bo co komu po\nnajlepszej dokumentacji \u015bwiata, kiedy nie ma dzia\u0142aj\u0105cej aplikacji. Jednak ka\u017cdy\nchce, \u017ceby jego praca by\u0142a traktowana powa\u017cnie. Nikt nie lubi, kiedy si\u0119 go\nspycha na koniec kolejki. Na szcz\u0119\u015bcie takie sytuacje s\u0105 rzadkie i wynikaj\u0105 z\nrealnego braku czasu i nagl\u0105cych termin\xf3w, a nie z niech\u0119ci lub lekcewa\u017cenia\npracy technical writer\xf3w."}),"\n",(0,o.jsx)(e.h4,{id:"co-najbardziej-lubisz-w-pracy-tech-writera",children:"Co najbardziej lubisz w pracy Tech Writera?"}),"\n",(0,o.jsx)(e.p,{children:"To, \u017ce ka\u017cdy dzie\u0144 jest inny. To, \u017ce opr\xf3cz pisania dokumentacji mog\u0119 rozwija\u0107\nsi\u0119 tak\u017ce na innych p\u0142aszczyznach, jak cho\u0107by tworzenie infografik czy user\nexperience, kt\xf3rym zainteresowa\u0142am si\u0119 w\u0142a\u015bnie dzi\u0119ki pracy technical writera.\nPrzede wszystkim jednak ceni\u0119 sobie to, \u017ce mia\u0142am okazj\u0119 pozna\u0107 zupe\u0142nie inny\n\u015bwiat i \u015bwietnych ludzi, z kt\xf3rymi mog\u0119 pracowa\u0107 na co dzie\u0144."}),"\n",(0,o.jsx)(e.h4,{id:"co-by\u015b-radzi\u0142a-osobom-kt\xf3re-chcia\u0142yby-zacz\u0105\u0107-swoj\u0105-przygod\u0119-z-pisaniem-dokumentacji",children:"Co by\u015b radzi\u0142a osobom, kt\xf3re chcia\u0142yby zacz\u0105\u0107 swoj\u0105 przygod\u0119 z pisaniem dokumentacji?"}),"\n",(0,o.jsx)(e.p,{children:"Je\u017celi kto\u015b obawia si\u0119, \u017ce nie zna si\u0119 na programowaniu albo nie ma\nwykszta\u0142cenia technicznego, to radzi\u0142abym si\u0119 tym nie przejmowa\u0107. Technical\nwriter powinien bardzo dobrze zna\u0107 angielski. Je\u015bli tylko ma troch\u0119 determinacji\ni ciekawo\u015bci, to wszystkiego innego dowie si\u0119 \u201epo drodze\u201d przy okazji pisania\ndokumentacji. Natomiast osobom, kt\xf3re ju\u017c wiedz\u0105, \u017ce to jest ich praca marze\u0144,\nradzi\u0142abym uzbroi\u0107 si\u0119 w cierpliwo\u015b\u0107 i spor\u0105 dawk\u0119 asertywno\u015bci. Pocz\u0105tki mog\u0105\nby\u0107 trudne, bo na studiach technicznych nie m\xf3wi si\u0119 o dokumentacji (ewentualnie\no dokumentacji kodu, ale to zupe\u0142nie inna bajka). Mo\u017cna trafi\u0107 do firmy, w\nkt\xf3rej deweloperzy nie rozumiej\u0105, jaka jest rola technical writera. Nie nale\u017cy\nsi\u0119 zniech\u0119ca\u0107, kiedy wsp\xf3\u0142praca na pocz\u0105tku si\u0119 nie uk\u0142ada. Trzeba zacisn\u0105\u0107\nz\u0119by, pokaza\u0107 warto\u015b\u0107 tego, co si\u0119 robi i nie da\u0107 si\u0119 odprawia\u0107 z kwitkiem.\nPotem jest ju\u017c z g\xf3rki \ud83d\ude09"}),"\n",(0,o.jsxs)(e.p,{children:["Je\u015bli chcecie skontakowa\u0107 si\u0119 z Agnieszk\u0105 albo sami macie ochot\u0119 podzieli\u0107 si\u0119\nswoimi do\u015bwiadczeniami, nie zwlekajcie d\u0142u\u017cej tylko piszcie na adres\n",(0,o.jsx)(e.a,{href:"mailto:kontakt@techwriter.pl",children:"kontakt@techwriter.pl"}),"."]})]})}function k(a={}){const{wrapper:e}={...(0,n.a)(),...a.components};return e?(0,o.jsx)(e,{...a,children:(0,o.jsx)(d,{...a})}):d(a)}},11151:(a,e,i)=>{i.d(e,{Z:()=>z,a:()=>r});var o=i(67294);const n={},t=o.createContext(n);function r(a){const e=o.useContext(t);return o.useMemo((function(){return"function"==typeof a?a(e):{...e,...a}}),[e,a])}function z(a){let e;return e=a.disableParentContext?"function"==typeof a.components?a.components(n):a.components||n:r(a.components),o.createElement(t.Provider,{value:e},a.children)}}}]);